using ProgettoSett.Models;



namespace ProgettoSett.Models
{

    public class Articolo
    {
        public int Id { get; set; }
        public string Immagine { get; set; }
        public string Nome { get; set; }
        public string Descrizione { get; set; }
        public double Prezzo { get; set; }
    }
    public static class ProdottiManager
    {
        public static List<Articolo> GetProdotti()
        {
            return new List<Articolo>
            {
              new Articolo { Id = 1,Immagine = ImageUrls.Prodotto1, Nome = "iPhone 13", Descrizione = "Ultimo modello di smartphone di Apple.", Prezzo = 999.99 },
                new Articolo { Id = 2,Immagine = ImageUrls.Prodotto2, Nome = "Samsung Galaxy S21", Descrizione = "Top di gamma di Samsung con fotocamera potente.", Prezzo = 899.99 },
                new Articolo { Id = 3,Immagine = ImageUrls.Prodotto3, Nome = "MacBook Pro 13\"", Descrizione = "Potente laptop di Apple per professionisti.", Prezzo = 1299.99 },
                new Articolo { Id = 4,Immagine = ImageUrls.Prodotto4, Nome = "Dell XPS 15", Descrizione = "Notebook premium con schermo 4K.", Prezzo = 1499.99 },
                new Articolo { Id = 5,Immagine = ImageUrls.Prodotto5, Nome = "PlayStation 5", Descrizione = "Console di gioco di ultima generazione.", Prezzo = 499.99 },
                new Articolo { Id = 6,Immagine = ImageUrls.Prodotto6, Nome = "Xbox Series X", Descrizione = "Potente console di gioco di Microsoft.", Prezzo = 499.99 },
                new Articolo { Id = 7,Immagine = ImageUrls.Prodotto7, Nome = "Samsung 4K Smart TV 55\"", Descrizione = "Smart TV Samsung con risoluzione 4K.", Prezzo = 999.99 },
                new Articolo { Id = 8,Immagine = ImageUrls.Prodotto8, Nome = "LG UltraWide Monitor 34\"", Descrizione = "Monitor ultrawide con colori vividi.", Prezzo = 699.99 },
                new Articolo { Id = 9,Immagine = ImageUrls.Prodotto9, Nome = "Apple AirPods Pro", Descrizione = "Cuffie true wireless con cancellazione del rumore.", Prezzo = 249.99 }
            };
        }

        public static Articolo GetProdottoById(int id)
        {
            List<Articolo> prodotti = GetProdotti();
            return prodotti.FirstOrDefault(p => p.Id == id);
        }
    }
}

